(function() {
    var protocol = stm_document,
        auto = !!protocol.properties['lecm-protocol:errands-autocreation'],
        tableAssocs = protocol.assocs['lecm-protocol-ts:points-assoc'],
        msg = 'Просрочено исполнение пункта #mainobject протокола #object1',
        autoCreateErrand = (statemachine.isStarter("lecm-errands:document") && auto),
        tableData, protocolPoints, i, point, isExpired, pointExecutors;

    if (tableAssocs && tableAssocs.length) {
        tableData = tableAssocs[0];
        protocolPoints = documentTables.getTableDataRows(tableData.nodeRef.toString());
        for (i in protocolPoints) {
            point = protocolPoints[i];
            isExpired = !!protocolService.checkPointExpiredStatus(point);
            if (isExpired) {
                businessJournal.log(point.nodeRef.toString(), 'PROTOCOL_POINT_EXPIRED', msg, [protocol.nodeRef.toString()]);
            } else {
                protocolService.changePointStatus(point.nodeRef.toString(), 'PERFORMANCE_STATUS');
            }
            pointExecutors = point.assocs['lecm-protocol-ts:executor-assoc'];
            if (pointExecutors && pointExecutors.length) {
                statemachine.grandDynamicRoleForEmployee(protocol, pointExecutors[0], 'PROTOCOL_POINT_EXECUTOR', task);
                notifications.sendNotification({
                    recipients: pointExecutors,
                    templateCode: 'PROTOCOL_POINT_EXECUTOR',
                    templateConfig: {
                        mainObject: protocol,
                        pointNumber: point.properties['lecm-document:indexTableRow']
                    }
                });
            }
        }

		/* формируем поручения */
        if (autoCreateErrand && protocolPoints && protocolPoints.length) {
          protocolService.formErrands(protocol);
        }
    }
})();

(function () {
    var protocol = stm_document,
        tableAssocs = protocol.assocs['lecm-protocol-ts:points-assoc'],
        tableData, protocolPoints, i, point, currentDate, executionDate;

    if (tableAssocs && tableAssocs.length) {
        tableData = tableAssocs[0];
        protocolPoints = documentTables.getTableDataRows(tableData.nodeRef.toString());
        currentDate = new Date();
        currentDate.setHours(0);
        currentDate.setMinutes(0);
        currentDate.setSeconds(0);
        currentDate.setMilliseconds(0);
        for (i in protocolPoints) {
            point = protocolPoints[i];
            executionDate = new Date(point.properties['lecm-protocol-ts:execution-date'].getTime());
            executionDate.setHours(0);
            executionDate.setMinutes(0);
            executionDate.setSeconds(0);
            executionDate.setMilliseconds(0);

			protocolService.changePointStatus(point.nodeRef.toString(), executionDate.getTime() >= currentDate.getTime() ? 'PERFORMANCE_STATUS' : 'EXPIRED_STATUS');
        }
    }
})();

/* направить на регистрацию */
(function () {
    var document = stm_document;
var registrationRequired = document.assocs["lecm-eds-document:document-type-assoc"][0].properties["lecm-doc-dic-dt:registration-required"];
	if (!registrationRequired) {
			document.properties["lecm-eds-aspect:change-status-to"] = "Согласован";
			document.save();
	} else {
		var autoRegistration = document.assocs["lecm-eds-document:document-type-assoc"][0].properties["lecm-doc-dic-dt:auto-registration"];
		if (autoRegistration) {
			var documentRegnum = document.properties["lecm-document:regnum"],
				projectNumber = document.properties["lecm-document-aspects:reg-project-data-number"],
				presentString = document.properties["lecm-document:present-string"],
				presentStringWithProjectNumber = presentString.replace(documentRegnum, projectNumber);

			lecmPermission.pushAuthentication();
			lecmPermission.setRunAsUserSystem();
			regnumbers.registerDocument(document, "PROTOCOL_NUMBER");
			lecmPermission.popAuthentication();

			edsDocument.sendNotificationAndLogAboutAutoRegistration(document, presentStringWithProjectNumber);

			document.reset();
			document.properties["lecm-eds-aspect:change-status-to"] = "Зарегистрирован";
			document.save();
		} else {
			var dutyRegistrar = edsGlobalSettings.getDutyRegistrar();
			var registrars = [];
			if (edsGlobalSettings.isRegistrationCenralized()) {
				registrars =  orgstructure.getEmployeesByBusinessRoleId("DA_REGISTRARS", true);
				if (registrars && registrars.length) {
					for each (var registrar in registrars) {
						statemachine.grandDynamicRoleForEmployee(document, registrar, "DA_REGISTRAR_DYN", task);
					}
				} else {
					registrars.push(dutyRegistrar);
					statemachine.grandDynamicRoleForEmployee(document, dutyRegistrar, "DA_REGISTRAR_DYN", task);
				}
			} else {
				var primaryPosition = orgstructure.getPrimaryPosition(orgstructure.getCurrentEmployee().nodeRef.toString());
                if (primaryPosition) {
                    var unit = orgstructure.getUnitByStaff(primaryPosition.nodeRef.toString());
					if (unit) {
						registrars = edsGlobalSettings.getPotentialWorkers('DA_REGISTRARS', unit.nodeRef.toString(), true);
						while (!registrars || !registrars.length) {
							unit = orgstructure.getParentUnit(unit.nodeRef.toString(), false);
							if (unit) {
								registrars = edsGlobalSettings.getPotentialWorkers('DA_REGISTRARS', unit.nodeRef.toString(), true);
							} else {
								break;
							}
						}
					}
                }
                var currentEmployee = orgstructure.getCurrentEmployee();
                var currentEmployeeOrganization = orgstructure.getEmployeeOrganization(currentEmployee);
                if (currentEmployeeOrganization) {
                    registrars = registrars.filter(function (item) {
                        return currentEmployeeOrganization.equals(orgstructure.getEmployeeOrganization(item));
                    });
                }
				if (registrars && registrars.length) {
					for each (var registrar in registrars) {
						statemachine.grandDynamicRoleForEmployee(document, registrar, "DA_REGISTRAR_DYN", task);
					}
				} else {
					registrars.push(dutyRegistrar);
					statemachine.grandDynamicRoleForEmployee(document, dutyRegistrar, "DA_REGISTRAR_DYN", task);
				}
			}
			/* уведомление */
			notifications.sendNotificationFromCurrentUser({
				recipients: registrars,
				templateCode: 'PROTOCOL_REGISTER',
				templateConfig: {
					mainObject: document
				},
				dontCheckAccessToObject: true
			});

			var logText = "#initiator направил(а) документ " + documentScript.wrapperDocumentLink(document, "№ {~REGNUM}") + " на регистрацию";
			logText = substitude.formatNodeTitle(document.nodeRef.toString(), logText);
			businessJournal.log(document.nodeRef.toString(), "DIRECT_DOCUMENT", logText, []);
		}
	}
})();

