(function () {
  var document = stm_document;
  var approvalDecision = approvalRoutes.getState(document);
  var registrationRequired = document.assocs["lecm-eds-document:document-type-assoc"][0].properties["lecm-doc-dic-dt:registration-required"];
	if (approvalDecision.contains("APPROVED") && routesGlobalSettings.getSettings().properties["lecmRoutesGlobalSettings:autoRoutingAfterApproval"] && registrationRequired) {
		document.properties["lecm-eds-aspect:change-status-to"] = "На регистрации";
		document.save();
    }
}) ();

(function(){
  	var protocol = stm_document;
	if(approvalRoutes.getState(protocol) == "UNDEF"){
    	var workFolder = approvalRoutes.createEmptyWorkingFolder(protocol);
		var route = approvalRoutes.createNewTemporaryNode(workFolder.getNodeRef(),"lecm-approval-route:route");
    	route.properties['cm:title'] = 'нетиповой маршрут';
      	route.properties['lecm-routes-v2:routeType'] = 'NOT_TYPICAL';
      	route.properties['lecm-approval-route:routeInterruptAfterReject'] = true;
      	route.properties['lecm-routes-v2:routeNotifyAboutEveryDecision'] = false;
      	route.properties['lecm-approval-route:afterApprovalExpired'] = 'NONE';
		route.save();
        route.removeAspect('sys:temporary');

        var stage = approvalRoutes.createNewTemporaryNode(route.getNodeRef(),"lecm-approval-route:stage");
		stage.properties['lecm-routes-v2:stageWorkflowType'] = "PARALLEL";
		stage.properties['lecm-routes-v2:stageWorkflowTerm'] = 1;
        stage.properties["cm:title"] = "Согласование протокола";
      	stage.save();
    	stage.removeAspect('sys:temporary');

    	var assocTypeQName = 'lecm-routes-v2:stageItemMemberAssoc';
        var signersRefsString = protocol.properties["lecm-protocol:signers-assoc-ref"];
        if (signersRefsString) {
          var signersRefs = signersRefsString.split(";");
          if (signersRefs){
              var signersCount = signersRefs.length;
              for(i = 0; i < signersCount; ++i) {
                  var signer = search.findNode(signersRefs[i]);
                  if (signer){
                      var stageItem = approvalRoutes.createNewTemporaryNode(stage.getNodeRef(),"lecm-approval-route:stageItem");
                      stageItem.properties['lecm-base-aspects:order'] = i;
                      stageItem.save();
                      stageItem.createAssociation(signer, assocTypeQName);
                      stageItem.removeAspect('sys:temporary');
                  }
              }
          }
        }

  }
})();
